import React from 'react';

import Second_Of_Five from './image/hiking.jpg';

const Hiking = () => {
  const containerStyle = {
    background: `url(${Second_Of_Five})`,
    backgroundSize: 'cover',
    backgroundPosition: 'right',
    backgroundRepeat: 'no-repeat',
    position: 'relative', // Add relative positioning to the container
    zIndex: -1, // Set a negative z-index to move the container behind other components
    width: "750px",
    height: '500px', // Set the desired height for the background image container
    

  };
  const imageCreditStyle = {
    position: 'absolute',
    bottom: '10px',
    right: '10px',
    background: 'rgba(0, 0, 0, 0.5)',
    color: '#fff',
    padding: '5px 10px',
    fontSize: '100px',
    borderRadius: '4px',
  };


  return (
    <div>
      <div style={containerStyle} />
      <div style={imageCreditStyle}>
        Photo by John Doe on Unsplash {/* Replace with the actual image credit */}
      </div>
     
    </div>
  );
}

export default Hiking;
